import React from "react";
import { FormEvent, useState } from "react";
import { Link, useHistory } from "react-router-dom";
import { LOGIN_ROUTE, REGISTRATION_ROUTE, HOME_ROUTE } from "../utils/const";

const Register = () => {
    return (
        <div className="w-screen min-h-screen mx-auto">
        <Link to={HOME_ROUTE} className="px- py-5 mx-74 text-base cursor-pointer transform hover:scale-125">
          Home
        </Link>
        <div className="px-8 py-12 m-auto md:w-3/6 lg:w-2/6 mt-28">
          <h1 className="px-4 mb-4 text-4xl font-bold text-center">Registration</h1>
          <form>
            <label>Username</label>
            <input
              className="block w-full px-3 py-2 text-gray-900 border border-purple-300 rounded-lg bg-gray-50 sm:text-md focus:ring-blue-500 focus:border-blue-500"
              type="login"
              placeholder="write your username..."
              //value={login}
              //onChange={e => setLogin(e.target.value)}
            />
            <br></br>
            <label>Password</label>
            <input
              placeholder="write your password..."
              className="block w-full px-3 py-2 text-gray-900 border border-purple-300 rounded-lg bg-gray-50 sm:text-md focus:ring-blue-500 focus:border-blue-500 "
              type="password"
              //value={password}
              //onChange={e => setPassword(e.target.value)}
            />
            <button
              type="submit"
              className="w-full px-2 py-1 mt-4 font-medium tracking-wide text-white bg-purple-600 rounded"
            >
              Sign in
            </button>
            <p className="mt-2 font-medium">
            Already have an account?{' '}
              <Link className="text-purple-800" to={LOGIN_ROUTE}>
                Log in
              </Link>
            </p>
          </form>
        </div>
      </div>
    );
};

export default Register;
